select(2, ...).LoadData("APP_INFO","Global",[[return {version=403,lastSync=1579667735,message={id=0,msg=""},news={{title="TradeSkillMaster v4.9.17 Changelog",content="TSM v4.9.17 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* The total posted auction stats in My Auctions will no longer include sold auctions<br />* Fixed issue with custom price source updates not properly reflecting until a reload<br />* Fixed issue with creating new profiles not working<br />* [Retail] Fixed issue with Accounting recording of purchases and sales with multiple sellers / buyers<br />* [Retail] Added new 8.3 bonusIds<br />* [Retail] Added &#8220;MAX&#8221; button to Shopping's commodity buyout confirmation dialog<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1579462276,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-9-17-changelog/"},{title="TradeSkillMaster v4.9.16 Changelog",content="TSM v4.9.16 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* Fixed issue with items not showing in Shopping search results in some situations<br />* [Retail] Fixed My Auctions total amounts<br />* [Retail] Fixed false-positive phasing messages<br />* [Retail] Fixed error after stopping a scan<br />* [Retail] Fixed issue with how Auctioning was rounding prices to the nearest silver<br />* [Retail] Fixed issue with trying to buy commodity items not always finding the auction<br />* [Retail] Fixed issue with purchased auctions not being counted towards mail inventory<br />* [Retail] Fixed issue with Shopping buy confirmation showing the incorrect auction price<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1579231740,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-9-16-changelog/"},{title="TradeSkillMaster v4.9.15 Changelog",content="TSM v4.9.15 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* Auctioning will now report a buyout above the gold cap as invalid<br />* [Retail] Fixed issue with changing the Auctioning post price<br />* [Retail] Fixed duration filtering in My Auctions<br />* [Retail] Fixed posted / sold auction totals in My Auctions<br />* [Retail] Fixed various issues with scans getting stuck<br />* [Retail] Fixed error when opening some AH mail<br />* [Retail] Optimized item-based scans (Auctioning and some Shopping scans)<br />* [Retail] Fixed issue with cancel scan incorrectly showing an auction as undercut immediately after posting<br />* [Retail] Fixed issue with cancel scan incorrectly showing auctions as undercut by the player<br />* [Retail] Fixed issue with auction order in the various auction table UIs<br />* [Retail] Fixed issue with default stack size when posting via Shopping<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1579212789,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-9-15-changelog/"},{title="TradeSkillMaster v4.9.14 Changelog",content="TSM v4.9.14 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* [Classic] Fixed issue with auction selection.<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1579134857,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-9-14-changelog/"},{title="TradeSkillMaster v4.9.13 Changelog",content="TSM v4.9.13 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* [Retail] Fixed issue with cancel scans.<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1579127220,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-9-13-changelog/"},{title="TradeSkillMaster v4.9.12 Changelog",content="TSM v4.9.12 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* [Retail] Fixed issue with canceling commodities.<br />* [Retail] Cancel scan fixes with items without bid on them.<br />* [Retail] Some other smaller fixes.<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1579124510,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-9-12-changelog/"},{title="TradeSkillMaster v4.9.11 Changelog",content="TSM v4.9.11 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* [Retail] Fixed bug with posting non-commodity items not properly undercutting<br />* [Retail] Fixed bug with canceling getting stuck on items posted pre-patch<br />* [Retail] Fixed issue with posting price when posting non-commodity items via Shopping<br />* [Retail] Fixed bug with sorting of auctions listed at the same price in TSM UIs<br />* [Retail] Fixed bug with Auctioning posting getting stuck on posting multiple non-commodity items<br />* [Retail] Fixed display of prices within Auctioning<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1579115255,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-9-11-changelog/"},{title="TradeSkillMaster v4.9.10 Changelog",content="TSM v4.9.10 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* [Retail] Bumped TOC version for patch 8.3<br />* [Retail] Fixed various issues which caused the scan to get stuck<br />* [Retail] Fixed various issues with Auctioning posting of non-commodities<br />* [Retail] Fixed searching for items with hyphenated names<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1579078844,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-9-10-changelog/"},{title="TradeSkillMaster v4.9.9 Changelog",content="TSM v4.9.9 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* Fixed row selection in MyAuctions.<br />* Auctioning Posting fixes.<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1579039388,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-9-9-changelog/"},{title="TradeSkillMaster v4.9.8 Changelog",content="TSM v4.9.8 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* Fixed error with canceling.<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1579029203,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-9-8-changelog/"}}}]]) --<APP_INFO,Global,1579667735>
